1. Complete Festival Preparation quests to earn Harmony Coins;
2. Collect Harmony Coins to purchase limited-edition new year items from the Treasure Emporium;
3. New year items can be sent to Superstrings in the dormitory as event gifts;
4. Festival Preparation quests will refresh daily for 7 days during the event;
5. Collect new year items to obtain Preparation progress, milestone rewards and Story Keys;
6. You can use Story Keys to unlock Story Events in the Harmony Promise;

Good luck Navigators, and happy Spring Blessing.

