1. Room popularity is bound to the room code. To participate in the Hot Leaderboard, you must first generate the code by sharing it.
2. Only the daily/weekly top 6 rule modes will enter the Hot Leaderboard;
3. Daily leaderboards refresh at 6 AM the following day;
4. Weekly leaderboards refresh at 6 AM the following Monday;
5. Popularity will be determined by the number of participants and length of participation.

